import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css'; // Add styles for Navbar if required
import search from './images/search.svg'; // Import your search icon image

const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="logo">Nova</div>
      <ul className="nav-links">
        <li><Link to="/">Home</Link></li>
        <li><Link to="/shop">Shop By</Link></li>
        <li><Link to="/contact">Contact</Link></li>
        {/* Use the img tag to display the search icon */}
        <li><img src={search} alt="Search" className="search-icon" /></li>
      </ul>
    </nav>
  );
};

export default Navbar;
